import { EPayWidget } from "./merchant.js";
EPayWidget.bind(
  "payment",
  {
    payment_id: "X03936", // Payment ID
    payment_amount: 2035, // Payment amount
    payment_currency: "USD", // Payment currency
    project_id: 59842, // Project ID
    signature: "YWb6Z20ByxpQ30hfTI.....",
  }, // Signature
  "post"
);

function PaymentEcommpay() {
  return (
    <div class="container">
      <button id="payment"></button>
    </div>
  );
}
export default PaymentEcommpay;
